import React from "react";
import pic from "./img/bg.png";

const Landing = () => {
  return (
    <div>
        <h1 className="m-2 max-w-lg text-2xl font-bold text-center md:text-4xl md:text-left sm:m-10">PLACEMENT PORTAL</h1>
      <div class="bg-indigo-300 ...">
        <img src={pic} class="object-cover h-48 w-96 ..." />
      </div>
    </div>
  );
};

export default Landing;
